(1, 1497974223, '<!--\n  29/01/2008\n  maquette : #2\n\n  modèle pour encart situé sur la home page\n  merci de respecter le balisage html et les indications CSS, l''indentation du code peut-être modifiée<br/>votre guise\n  les commentaires peuvent être supprimés sur la version finale\n -->\n <div id="rateContent"><!-- ce divau et paragraphe suivant identiques<br/>ceux de l''encart de la home finance -->\n  <div class=''container_sg_cac40''>\n    <span class=''container_sg_cac40_span''>\n      <span class="leftCell">Saint-Gobain</span>  \n      <span class="single">48,340 €</span>\n      <span>-0,67%</span>\n    </span>\n    <span class=''container_sg_cac40_span''>\n      <span class="leftCell">CAC40</span>\n      <span class="single">5 293,65</span>\n      <span>-0,32%</span>\n    </span>\n  </div>\n</div>\n<p class=''bourse_xml''>(Paris)<br/>20/06/2017<br/>17:35:10</p>\n<!-- largeur de l''image<br/>160 pixels<br/>respecter, la hauteur peut varier au besoin -->\n<p class=''bourse_xml''><img style=''display:none;'' src="https://saintgobain.symex.be/png/pngchart.php?Largeur=200&Hauteur=&language=fr" title="Courbe du cours de l’action Saint-Gobain et du CAC 40 sur un an glissant" alt="Courbe du cours de l’action Saint-Gobain et du CAC 40 sur un an glissant" width="200" height="142" /></p>');
